import React, { useState } from 'react'
import sampleIcon from '../../assets/images/default.png'
import AdminCategory from '/AdminCategory';
import AdminCustomCompany from './AdminCustomCompany';
import AdminCustomJob from './AdminCustomJob';
// import Category from '../user/categories/Category'

const AdminItem = () => {
    return (
        <>
            <AdminCategory />
            <AdminCustomCompany />
            <AdminCustomJob />
        </>
    )
}

export default AdminItem
